@-moz-document domain("docs.google.com") {
#docs-bars {
    margin-top: 0px;
}
#docs-branding-container.docs-branding-documents {
    background-color: rgba(66, 133, 244, 0);
}
#docs-branding-container.docs-branding-spreadsheets {
    background-color: rgba(15, 157, 88, 0);
}
#docs-branding-logo {
    height: 84px;
    width: 64px;
}
#docs-chrome {
    background: #e5e5e5;
}
#docs-dlp,
#docs-star,
#docs-folder .docs-icon {
    z-index: 1000;
}
#docs-docos-commentsbutton {
    background-color: transparent;
    background-image: none;
    border-style: none;
    font-family: Roboto, Calibri;
    margin-top: 23.25px;
    text-shadow: 0px 0px .001px rgba(0, 0, 0, .1);
    text-transform: uppercase;
}
#docs-docos-commentsbutton:active {
    background-color: rgba(153, 153, 153, .40);
    box-shadow: none;
}
#docs-docos-commentsbutton:hover {
    background-color: rgba(153, 153, 153, .20);
}
#docs-file-menu {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    transition: all 0.30s ease-in-out;
}
#docs-menubars {
    background-image: url(https://addons.cdn.mozilla.net/user-media/addons/188201/preview_large.jpg);
    font-weight: bold;
    height: 25px;
}
#docs-side-toolbar {
    padding-top: 10px;
}
#docs-star,
#docs-folder .docs-icon {
    margin-top: 7px;
}
#docs-title-untitled {
    color: #000000;
    font-size: 22px;
    opacity: .55;
}
#docs-titlebar-share-client-button div.jfk-button {
    background-color: #4285f4;
    background-image: url(https://raw.githubusercontent.com/google/material-design-icons/1.0.0/social/2x_web/ic_share_white_48dp.png);
    background-origin: padding-box;
    background-position: center;
    background-repeat: no-repeat;
    background-size: 24px 24px;
    border: none;
    border-radius: 50%;
    border-style: none;
    bottom: 75px;
    box-shadow: 0px 2px 10px rgba(0, 0, 0, .3), 0px 0px 1px rgba(0, 0, 0, .1), inset 0px 1px 0px rgba(255, 255, 255, .25), inset 0px -1px 0px rgba(0, 0, 0, .15);
    content: url(https://i.imgur.com/7plkVCY.png);
    cursor: pointer;
    height: 40px;
    min-width: 40px;
    padding: 8px;
    position: fixed;
    right: 42px;
    transition-duration: .25s;
    transition-property: box-shadow, background-color;
    width: 40px;
    z-index: 1999;
}
#docs-titlebar-share-client-button div.jfk-button jfk-button-hover {
    background-color: #5291f9;
    box-shadow: 0px 5px 5px rgba(0, 0, 0, .2), 0px 10px 14px rgba(0, 0, 0, .1), inset 0px 1px 0px rgba(255, 255, 255, .25), inset 0px -1px 0px rgba(0, 0, 0, .10);
    transition-duration: .25s;
    transition-property: box-shadow, background-color;
}
#docs-titlebar-share-client-button div.jfk-button:hover {
    background-color: #5291f9;
    box-shadow: 0px 5px 5px rgba(0, 0, 0, .2), 0px 10px 14px rgba(0, 0, 0, .1), inset 0px 1px 0px rgba(255, 255, 255, .25), inset 0px -1px 0px rgba(0, 0, 0, .10);
    transition-duration: .25s;
    transition-property: box-shadow, background-color;
}
#docs-toolbar-wrapper {
    background-color: #F1F1F1;
    background-image: url(https://addons.cdn.mozilla.net/user-media/addons/20267/preview_large.jpg);
    border: none;
    height: 25px;
    outline: none;
    width: 100%;
}
#gba.gb_4a {
    background-color: lightgrey;
}
#gba.gb_ab {
    background-color: lightgrey;
    height: 28px;
}
#gbgs4d {
    font-family: Roboto, Calibri;
}
.docs-branding-spreadsheets #docs-branding-logo .docs-branding-documents #docs-branding-logo #docs-branding-container a {
    background-color: rgba(156, 194, 255, 0.02);
    background-image: url(http://icons.iconarchive.com/icons/ahdesign91/project/512/MS-Office-icon.png);
    background-position: center;
    background-size: 54px;
}
.docs-branding-spreadsheets #docs-branding-logo,
.docs-branding-documents #docs-branding-logo {
    background: url(http://icons.iconarchive.com/icons/ahdesign91/project/512/MS-Office-icon.png);
    background-position: center;
    background-repeat: no-repeat;
    background-size: 54px;
}
.docs-icon-folder-solid {
    background-image: url(http://google.github.io/material-design-icons/file/svg/ic_folder_24px.svg);
    background-position: center;
    background-repeat: no-repeat;
    background-size: 19px;
    content: url(http://i.imgur.com/7plkVCY.png);
    height: 19px;
    left: 1px;
    top: 1px;
    width: 19px;
}
.docs-menubar {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    transition: all 0.30s ease-in-out;
}
.docs-menubar .goog-control {
    font-family: Roboto, Calibri;
    font-weight: bold;
    margin-top: 0px;
    text-shadow: -1px 0.05px 0.1px rgba(255, 255, 255, 1);
}
.docs-menubar .goog-control-hover {
    background-color: rgba(0, 0, 0, 0.15);
}
.docs-menubar .goog-control-open {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    border-style: none;
    transition: all 0.30s ease-in-out;
}
.docs-title {
    color: #000;
    font-size: 24px;
    font-style: normal;
    opacity: 1;
}
.docs-title-inner {
    color: #000;
    font-size: 22px;
    font-style: normal;
    opacity: 1;
}
.docs-title-outer.docs-title-inline-rename {
    background-color: lightgrey;
}
.docs-title-save-label {
    color: #000000;
    font-family: Roboto, Calibri;
    font-size: 13px;
    opacity: .55;
    text-shadow: -1px 0.05px 0.08px rgba(255, 255, 255, 1);
}
.docs-title-untitled {
    color: #000000;
    font-size: 22px;
    opacity: .55;
}
.docs-title-widget {
    color: #000000;
    font-family: Roboto, Calibri;
    font-style: normal;
    margin-left: 28px;
    margin-top: 2px;
    opacity: .87;
    text-shadow: 0px 0px .00001px rgba(0, 0, 0, .5);
}
.goog-menu {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    box-shadow: 1px 3px 3px rgba(0, 0, 0, .54);
    font-weight: bold;
    opacity: 0.9;
    transition: all 0.30s ease-in-out;
}
.goog-menuitem-content {
    opacity: 1;
    padding-left: 32px;
}
.goog-option-selected {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    background-image: url(https://raw.githubusercontent.com/google/material-design-icons/master/navigation/2x_web/ic_check_black_48dp.png);
    background-position: 16px;
    background-size: 24px;
    opacity: .5;
    padding-left: 32px;
    transition: all 0.30s ease-in-out;
}
.goog-toolbar-button {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    transition: all 0.30s ease-in-out;
}
.goog-toolbar-button-checked {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    background-color: rgba(0, 0, 0, .1);
    background-image: none;
    border-color: transparent;
    box-shadow: none;
    transition: all 0.30s ease-in-out;
}
.goog-toolbar-button-hover,
.goog-toolbar-menu-button-hover {
    -moz-transition: all 0.30s ease-in-out;
    -ms-transition: all 0.30s ease-in-out;
    -o-transition: all 0.30s ease-in-out;
    -webkit-transition: all 0.30s ease-in-out;
    background-color: rgba(0, 0, 0, .05);
    background-image: none;
    border-color: transparent;
    box-shadow: none;
    transition: all 0.30s ease-in-out;
}
.goog-toolbar-combo-button-input {
    font-family: Roboto, Calibri;
    font-weight: normal;
    position: relative;
    text-shadow: 0px 0px .00001px rgba(0, 0, 0, .5);
}
.goog-toolbar-select .goog-toolbar-menu-button-outer-box .goog-toolbar-menu-button-inner-box .goog-toolbar-menu-button-caption {
    font-family: Roboto, Calibri;
    font-weight: normal;
    text-shadow: 0px 0px .00001px rgba(0, 0, 0, .5);
}
.jfk-tooltip-arrow {
    display: none;
}
